import './App.css';
import DatePicker from "./Date";
import "./App.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import Navigation from './Component/Navigation'

function App(){
  return (
    <div className="App">
      <Navigation />
      <div>
        {<DatePicker />}
      </div>
    </div>
  );
}

export default App;
